import CollectionReport from '@/model/autotest/collection-report'

export default {
  data() {
    return {
      search: {
        page: 1,
        count: 10,
        collection_name: '',
      },
      total: 0,
      report_list: [],
    }
  },
  methods: {
    async getReportList() {
      const res = await CollectionReport.searchReportList(this.search)
      this.report_list = res.items
      this.total = res.total
    },
    handleSizeChange(val) {
      this.search.count = val
      this.getReportList()
    },
    handleCurrentChange(val) {
      this.search.page = val
      this.getReportList()
    },
    checkDetail(id) {
      this.$router.push(`/api-test/report-detail/${id}`)
    }
  },
  mounted() {
    this.getReportList()
  }
}
